import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import Logo1 from '../assets/logo1.jpg';

const Navbar = () => {
  const [isPopupVisible, setIsPopupVisible] = useState(false);

  const showPopup = () => {
    setIsPopupVisible(true);
  };

  const hidePopup = () => {
    setIsPopupVisible(false);
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <Link to="/">
          <img src={Logo1} alt="QueueBy6 Logo" className="app-logo" />
          <span className="navbar-logoword">QUEUECARE</span>
        </Link>
      </div>
      <ul className="navbar-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/dashboard">Dashboard</Link></li>
        <li><button onClick={showPopup} className="login-button">Login</button></li>
      </ul>
      {isPopupVisible && (
        <div className="popup" onClick={hidePopup}>
          <div className="popup-content" onClick={(e) => e.stopPropagation()}>
            <span className="close" onClick={hidePopup}>&times;</span>
            <h2>Login</h2>
            <form id="loginForm">
              <label htmlFor="username">Username:</label>
              <input type="text" id="username" name="username" required />
              <label htmlFor="password">Password:</label>
              <input type="password" id="password" name="password" required />
              <button type="submit">Login</button>
            </form>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
